import React from 'react';
import { Link } from 'react-router-dom';

const Cocktail = ({
  strDrink,
  strGlass,
  strAlcoholic,
  strDrinkThumb,
  strInstructions,
}) => {
  return (
    <div className="cocktail">
      <img className="img" src={strDrinkThumb} alt={strDrink} />
      <h3>{strDrink}</h3>
      <p>{strGlass}</p>
      <p>{strAlcoholic}</p>
    </div>
  );
};

export default Cocktail;
